import '../dash.css';
const Dashboard=()=>{
    return (
        <div className="dashboard">
            <div className='content'>
                <div class="content-1">Content 1</div>
                <div class="content-2">Content 2</div>
            </div>
        </div>
        
    )
}
export default Dashboard;
